/**
* base64エンコード
* @see http://qiita.com/weal/items/1a2af81138cd8f49937d
* @param {string} str エンコード対象文字列
* @return {string} エンコード後文字列
*/
export function base64Encode(str){
  return btoa(unescape(encodeURIComponent(str)));
}

/**
* base64デコード
* @see http://qiita.com/weal/items/1a2af81138cd8f49937d
* @param {string} str デコード対象文字列
* @return {string} デコード後文字列
*/
export function base64Decode(str){
  return decodeURIComponent(escape(atob(str)));
}

import {base64Encode,base64Decode} from './base64'

/*
* ローカルストレージのKeyのプレフィックス
*/
const LOCAL_STORAGE_PREFIX = "kyo-do.co.";

/**
* localStorageへ値をセットする
* @param {string} key キー
* @param {Object} value セットするオブジェクト
* @return {undefined}
*/
export function setToStorage(key,value){
  localStorage.setItem(LOCAL_STORAGE_PREFIX + key,base64Encode(JSON.stringify(value)));
}
/**
* localStorageから値を取得する
* @param {string} key キー
* @return {Object} localStorageに保存されたオブジェクト
*/
export function getFromStorage(key){
  return JSON.parse(base64Decode(localStorage.getItem(LOCAL_STORAGE_PREFIX + key)));
}
/**
* localStorageから値を削除する
* @param {string} key キー
* @return {undefined}
*/
export function removeFromStorage(key){
  localStorage.removeItem(LOCAL_STORAGE_PREFIX + key);
}

/**
* localStorage上にキーが存在するかを確認する
* @param {string} key キー
* @return {boolean} 存在すればTrue
*/
export function existsKeyOnStorage(key){
  return localStorage.getItem(LOCAL_STORAGE_PREFIX + key) !== null;
}

import {UPDATE_MEMBER_STATUS} from '../action/board'

/**
* 行き先掲示板 reducer
* @see http://qiita.com/yasuhiro-okada-aktsk/items/9d9025cb58ffba35f864
* @param {Object} state 変更前のstate
* @param {Object} action dispatchされたaction
* @return {Object} 変更後のstate
*/
export default function board(state={memberStatus:{}},action){
  switch(action.type){
    case(UPDATE_MEMBER_STATUS):
      return Object.assign({},state,{memberStatus:action.payload});
    default:
      return state;
  }
}

import {LOGIN_STATUS} from '../const/login'
import {LOGIN_SUCCESS,LOGIN_FAILURE,LOGIN_REQUESTED,LOGOUT_REQUESTED} from '../action/login'

/**
* ログイン reducer
* @see http://qiita.com/yasuhiro-okada-aktsk/items/9d9025cb58ffba35f864
* @param {Object} state 変更前のstate
* @param {Object} action dispatchされたaction
* @return {Object} 変更後のstate
*/
export default function login(state={status:"NOTYET",user:{}}, action){
  switch(action.type){
    case LOGIN_SUCCESS:
      return {status:LOGIN_STATUS.SUCCESS,user:action.payload};
    case LOGIN_FAILURE:
      return {status:LOGIN_STATUS.FAILURE,user:{}};
    case LOGOUT_REQUESTED:
      return {status:LOGIN_STATUS.NOTYET,user:{}};
    case LOGIN_REQUESTED:
      return {status:LOGIN_STATUS.NOTYET,user:{}};
    default:
      return state;
  }
}

